Star Wars - The Original Trilogy (Theatrical Cut) in 720p

This contains Harmy's de-specialized edition of Star Wars episode IV,V &amp; VI. All credits go to him and his team for this professional grade restoration. 

Rumour has it that even George Lucas owns a copy of Harmy's work since his master of the original theatrical cut got lost.

Included subtitles : English, Spanish, German, French, Italian, Dutch, Russian.

